import React from 'react'
import ToDoSpan from "./to-do-span";
import ToDoFilter from "./to-do-filter";


const ToDoFooter = () => {
    return (
        <footer>
           <ToDoSpan className="todo-count" label="1 items left"/>
            <ToDoFilter/>
            <ToDoSpan className="clear-completed" label="Clear completed"/>
        </footer>
    );
}


export default ToDoFooter;
